import React, { Component } from "react";
import "./Crypto.css";

function Crypto(props) {
  return (
    <tr>
      <th scope="row">{props.info.cmc_rank}</th>
      <td>
        <div className="row align-items-center">
          <div className="col-5">
            <img
              src={props.info.imageURL}
              className="card-img-top"
              alt={props.info.name}
            />
          </div>
          <div className="col-5">{props.info.name}</div>
        </div>
      </td>
      <td>{props.info.quote.USD.price}</td>
      <td>{props.info.quote.USD.percent_change_24h}</td>
      <td>{props.info.quote.USD.volume_24h}</td>
      <td>{props.info.quote.USD.market_cap}</td>
    </tr>
  );
}

export default Crypto;
